import React from 'react'
import { Dropdown, Input } from 'semantic-ui-react'

const options = [
  {key: "role", text: "By Role", value: "role"},
  {key: "name", text: "By Name", value: "name"}
]

const EmployeeFilter = () => {
  return (
    <div>
      <Input in
        action={
          <Dropdown
           button basic floating options={ options } defaultValue='role' />
        }
        icon='search'
        iconPosition='left'
        inverted
      />
    </div>
  )
}

export default EmployeeFilter
